import React from 'react'
import { useNavigate } from 'react-router-dom';

const FeatureList = () => {
    const navigate = useNavigate();
  return (
    <div className="container max-h-300">
      <button className="text-white my-100 bg-green-600 hover:bg-green-800 rounded px-4 py-2 mx-auto block">
        Employee List
      </button>
      <button
        className="text-white m-100 bg-green-600 hover:bg-green-800 rounded px-4 py-2 mx-auto block"
        onClick={() => navigate("/addEmployee")}
      >
        Add Employee
      </button>
    </div>
  );
}

export default FeatureList;
